import Navbar from "./components/NavBar/navbar";
import Header from "./components/Header/header";
import AboutMe from "./components/AboutMe/aboutme";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
          <Navbar></Navbar>
          <Header></Header>
      </div>
    </BrowserRouter>
  );
}

export default App;
